import * as React from "react";

import "../styles/style.css";
import { ComponentMap } from "../constants/constants";
import { Layout } from "../types/model";

// data is the data from db.json

// Compononet is first element of rootElement selected by type using map of components

// render selected Component with its props

type ContentProps = {
  data: Layout;
};

export default function Content({ data }: ContentProps) {
  const Component = ComponentMap[data.rootElement.type];
  //@ts-ignore
  // ts-ignore because of: Type '{ type: "verticalSplitter"; elements: ElementsType[]; elementKey: string; } | { type: "textTile"; title?: string | undefined; text?: string | undefined; color?: Color | undefined; elementKey: string; } | { ...; } | { ...; } | { ...; }' is not assignable to type 'never'.
  // The intersection 'IntrinsicAttributes & VerticalSplitter & HorizontalSplitter & ImageTile & TextTile & ButtonTile' was reduced to 'never' because property 'type' has conflicting types in some constituents.
  // Type '{ type: "verticalSplitter"; elements: ElementsType[]; elementKey: string; }' is not assignable to type 'never'.
  // pass props from a given component
  return <Component {...data.rootElement} />;
}
